function configChart(data, _apiItem) {
  const passData = data.filter((item, idx) => {
    if (idx % 5 === 0) {
      console.log(item._apiItem);
      return item._apiItem;
    }
  });

  passData.map(filt => {
    return filt._apiItem;
  });
}

export { configChart };
